import axios from 'axios'

const TEAM_API_BASE_URL = 'http://localhost:8080/employees'

const TEAM_API_VAL_URL = 'http://localhost:8080/validateUser'

class TeamService{
    getEmployees(){
        return axios.get(TEAM_API_BASE_URL)
    }
    validateUser(param1, param2){
        return axios.get(TEAM_API_VAL_URL||'?param1=${param1}&param2=${param2}')
    }
}

export default new TeamService()
